// Type definitions
export type Word3Letters = typeof words.words3Letters[number];
export type Word4Letters = typeof words.words4Letters[number];
export type Word5Letters = typeof words.words5Letters[number];
export type Word6Letters = typeof words.words6Letters[number];
export type WordleWord = Word3Letters | Word4Letters | Word5Letters | Word6Letters;

// Flattened word list for internal use
const wordleWords: readonly string[] = [
  ...words.words3Letters,
  ...words.words4Letters,
  ...words.words5Letters,
  ...words.words6Letters,
];

// Helper functions
export const isValidWord = (word: string): word is WordleWord => 
  (wordleWords as readonly string[]).includes(word.toLowerCase());

export const getWordsByLength = (length: 3 | 4 | 5 | 6) => {
  const key = `words${length}Letters` as keyof typeof words;
  return words[key];
};

export const ENGLISH_WORDS = wordleWords.map(w => w.toUpperCase());
